import Home from "./components/Home";
import Navbar from "./components/Navbar";

function App() {
  return (
    <div className="w-screen justify-center flex px-4">
      <div className="max-w-[1024px] w-full">
        <Navbar />
        <Home />
      </div>
    </div>
  );
}

export default App;
